//상단바 (Frame) 와 Footer 함수가 정의되어 있음

import './frame.css';
import {Logo, LogoAdd} from '../../logo.js';
import { useState } from 'react';

import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react-router-dom';


function 아래화살표(){
  return (
    <img src="iconDown.png"
    width="10px"/>
  );
}



function Bars(){
    const [isActive, setIsActive] = useState(true);
    const handleClick = () => {
      setIsActive(!isActive);
    };

  return(
    <div className='Box'>
    <li onClick={handleClick}>서비스 소개 <아래화살표/></li>
    <div className={`bars ${isActive ? 'visible-element' : 'hidden-element'}`}>
        <ul>
          <li><a href="./인사말">인사말</a></li>
          <li><a href="./안내">홈페이지 안내</a></li>
        </ul>
    </div>

    </div>
  );
}

export function Frame(){

    return(
        <div>
          <div id="user">
            <a href="/login" className ="topNav">로그인</a>
            <a href="/account" className ="topNav">회원가입</a>
          </div>
          <div id="menu">
            <LogoAdd/>
            <nav id ="mainNav">
              <ul className = "horizontal-list">
                <Bars/>
                <li><a to="/게시판">게시판 <아래화살표/> </a></li>
                <li><a href="/update.html">데이터 업로드 <아래화살표/> </a></li>
              </ul>
            </nav>
          </div>
        </div>

    );
  }

export function Banner({name}){

return (
    <div class="banner">
      <h1>{name}</h1>
      <img src="banner.jpg"/>
    </div>
);
}

export function ContentNav({name}){
  return (
    <nav className="contentNav">
        <ul>
            <li id="iconHome">
                <a href="./">
                    <img src="iconHome.png" width="20px"/>
                </a>
            </li>
            <li className="contentNav한칸">
                <a href="./">
                    <p>{name}</p>
                    <아래화살표/>
                </a>
            </li>
            <li className="contentNav한칸">
                <a href="./">
                    <p>인사말</p>
                    <아래화살표/>
                </a>
            </li>
        </ul>
    </nav>
    );
}


export function Footer(){
  return(
      <div className='footer'>
          <div className="footerBox">
              <Logo/>
              <div>
                  <div className="footerInfo">
                      <div>서울시 광진구 능동로 209 세종대학교</div>
                      <div>TEL : 010-@@@@-@@@@</div>
                      <div>Email : @sju.ac.kr</div>
                  </div>
                  <div>Copyright@ 2023 Sejong RDD | All Rights Reserved</div>
              </div>
          </div>
      </div>
  );
}
